import React from "react";

const products = [
    {
        "id":1,
        "name": "Nick",
    },
    {
        "id":2,
        "name": "Adidas",
    },
    {
        "id":1,
        "name": "gocommet",
    },
    {
        "id":1,
        "name": "Ram",
    }
]
export default function Sidenav(){
    return(
    <div >
        Fliters
        <div className="gender">
            <input type="checkbox" value="Men"/>Men
        </div>
        <div className="gender"><input type="checkbox" value="Women"/>women</div>
        <div className="gender"><input type="checkbox" value="Boys"/>Boys</div>
        <div className="gender"><input type="checkbox" value="Girls"/>Girls</div>
    </div>
    )
}
